Plot: From the creator of Family Guy and the co-creator of American Dad! Comes a brand-new animated series of pop culture parodies, skewered stories, and fabulously filthy fun nuggets. Uncensored, uninhibited and unbelievably hilarious, Seth MacFarlanes Cavalcade of Cartoon Comedy is brimming with the kind of raunchy, twisted humor you can't see on television no matter how hard you try. So sit back, veg out and enjoy the show. The possibilities are endless...and so are the laughs!

